import React from "react";

export function ThumbContainer(props) {
  return (<div className="thumb-container">
    {props.icons.map((icons,i) =>{
                        console.log(icons.icon)
                        return (
                          <vi key={i} iconUrl={icons.icon}  
                          title={icons.title}/>
                        )}
        )}
          </div>   ) 
}
